import React, { useEffect, useState } from "react";
import PageContainer from "../../components/PageContainer";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableFooter,
  TableHead,
  TableRow,
} from "@mui/material";
import Paper from "@mui/material/Paper";
import { CarsProps } from "../../utils/types/Cars";
import TablePagination from "@mui/base/TablePagination";

function createData(
  name: string,
  calories: number,
  fat: number,
  carbs: number,
  protein: number
) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData("Frozen yoghurt", 159, 6.0, 24, 4.0),
  createData("Ice cream sandwich", 237, 9.0, 37, 4.3),
  createData("Eclair", 262, 16.0, 24, 6.0),
  createData("Cupcake", 305, 3.7, 67, 4.3),
  createData("Gingerbread", 356, 16.0, 49, 3.9),
];

const Listings: React.FC = () => {
  const [data, setData] = useState<CarsProps[]>([]);
  const [dataDefault, setDataDefault] = useState<CarsProps[]>([]);
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(15);

  const handleChangePage = (
    event: React.MouseEvent<HTMLButtonElement> | null,
    newPage: number
  ) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (
    event: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>
  ) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("/api/cars");
      const responseData = await response.json();

      setData(responseData);
      setDataDefault(responseData);
    };

    getData();
  }, []);

  console.log(data);

  return (
    <PageContainer>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
          <TableHead>
            <TableRow>
              <TableCell className="text-center">Ações</TableCell>
              <TableCell className="text-center">Veículo / Modelo</TableCell>
              <TableCell className="text-center">Marca</TableCell>
              <TableCell className="text-center">Cor</TableCell>
              <TableCell className="text-center">Ano</TableCell>
              <TableCell className="text-center">Placa</TableCell>
              <TableCell className="text-center">Data da compra</TableCell>
              <TableCell className="text-center">Data da venda</TableCell>
              <TableCell className="text-center">Estoque</TableCell>
              <TableCell className="text-center">Valor Compra</TableCell>
              <TableCell className="text-center">Valor Venda</TableCell>
              <TableCell className="text-center">Total despesas</TableCell>
              <TableCell className="text-center">É consignado?</TableCell>
              <TableCell className="text-center">Lucro</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map(
                ({
                  id_car,
                  modelo,
                  marca,
                  cor,
                  ano,
                  placa,
                  dt_venda,
                  dt_compra,
                  consignado,
                  valor_compra,
                  valor_venda,
                  despesas,
                }) => (
                  <TableRow
                    key={row.name}
                    sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                  >
                    <TableCell component="th" scope="row">
                      {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                  </TableRow>
                )
              )}
          </TableBody>
          <TableFooter>
            <TableRow>
              <TablePagination
                labelRowsPerPage="Linhas por páginas"
                rowsPerPageOptions={[10, 25, { label: "All", value: -1 }]}
                colSpan={14}
                count={car.length}
                rowsPerPage={rowsPerPage}
                page={page}
                slotProps={{
                  select: {
                    "aria-label": "Linhas por páginas",
                  },
                  // actions: {
                  //   showFirstButton: true,
                  //   showLastButton: true,
                  // },
                }}
                onPageChange={handleChangePage}
                onRowsPerPageChange={handleChangeRowsPerPage}
              />
            </TableRow>
          </TableFooter>
        </Table>
      </TableContainer>
    </PageContainer>
  );
};

export default Listings;
